__NUXT_JSONP__("/boten/moonraker", (function(a,b,c){return {data:[{story:{name:c,created_at:"2021-04-09T10:20:51.297Z",published_at:"2021-04-09T10:48:43.404Z",alternates:[],id:44967352,uuid:"0ffc189b-0b04-4542-8419-059d200ae49f",content:{_uid:"8fd9c97c-d570-4b05-853a-6cda9020e8c7",titel:c,images:[{id:2131137,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F512x357\u002Fa0c2c6a28c\u002F13d.jpg",copyright:a},{id:2131133,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F1024x300\u002F9dfef68612\u002F13a.jpg",copyright:a},{id:2131134,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F900x550\u002Ff7ad01d716\u002F13b.jpg",copyright:a},{id:2131136,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F900x550\u002F2d98367726\u002F13c.png",copyright:a},{id:2131135,alt:a,name:b,focus:a,title:a,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F900x550\u002F9e33118fa6\u002F13c.jpg",copyright:a}],component:"boten",thumbnail:"\u002F\u002Fa.storyblok.com\u002Ff\u002F106943\u002F512x357\u002Fee039945f7\u002F13d.jpg",uitvoering:"**Uitvoeringen:**\n\n* 900\n* 1200",beschrijving:"**Bond; James Bond**  \nDe D&Ø Moonraker is vernoemd naar een James Bond film. Hij combineert uitstekende sportieve en praktische vaareigenschappen met een uniek hightech uitstraling. De D&Ø Moonraker is in alle opzichten een opvallende verschijning, met een zeer uitgesproken karakter.\n\n**Hightech belijning**  \nAan het opvallende windscherm ziet u meteen dat de D&Ø Moonraker een bijzondere boot is. Het designteam van D&Ø heeft de boot compleet naar eigen inzicht getekend. Het resultaat is een uniek en eigenzinnig design met een sterk hightech gevoel.\n\n Dit wordt versterkt door het gebruik van materialen als carbonfibre, aluglasweefsel en aluminium sandwichpanelen. In combinatie met de 6mm dikke aluminium romp met matzwarte finish en de verzonken bolders zorgt het voor een stoere, hightech uitstraling, die doet denken aan stealthjagers. \n\n**Stoer uiterlijk met indrukwekkende vaareigenschappen**  \nDe D&Ø Moonraker koppelt als echte sportboot zijn stoere uiterlijk aan indrukwekkende vaareigenschappen. De 2 Yanmar BMW-motoren leveren elk 260 PK en zorgen voor een topsnelheid van maar liefst 37 knopen. De relaxte zit achter het roer biedt voldoende ruggensteun voor 3 personen. Alle meters zijn in een oogopslag te zien, alle instrumenten zijn onder handbereik en dankzij het grote glazen windscherm is het zicht uitstekend.\n\n**Comfort**  \nHet comfort op de D&Ø Moonraker is dik in orde. De ruime kajuit is hoog genoeg om in te staan en is onder andere uitgerust met een 2-persoons bed, een zitruimte, een douche en toilet en een koelkast.\n\n Het zonnedek van de D&Ø Moonraker biedt comfortabel plaats aan drie personen. Onder het zonnedek is een praktische opslagruimte voor stootboeien, waterski’s of extra kussens. Kortom de D&Ø Moonraker is een unieke sportboot, heerlijk om op te vertoeven, heerlijk om mee te varen en gegarandeerd een opvallende verschijning op het water.\n\n**Custom made**  \nDe D&Ø Moonraker is een custom made sportboot, geheel naar wens van de koper hebben wij deze hightech sportieve sportboot gebouwd. Samen met de klant en het designteam van Davy & Ørsted zijn wij in staat de meest bijzondere boten te bouwen, wij houden wel van een uitdaging!",specificaties:"volgt nog",calltoaction_text:"Wilt u ook eens voelen hoe het is om James Bond te zijn?\nVraag hier uw proefvaart aan",korte_beschrijving:"Bond: James Bond  \nDe D&Ø Moonraker is vernoemd naar een James Bond film. Hij combineert uitstekende sportieve en praktische vaareigenschappen met een uniek hightech uitstraling. De D&Ø Moonraker is in alle opzichten een opvallende verschijning, met een zeer uitgesproken karakter."},slug:"moonraker",full_slug:"boten\u002Fmoonraker",default_full_slug:a,sort_by_date:a,position:-30,tag_list:[],is_startpage:false,parent_id:43882559,meta_data:a,group_id:"ebed3c5c-03ce-4ca8-a54d-067840d9afe9",first_published_at:"2021-04-09T10:23:17.000Z",release_id:a,lang:"default",path:a,translated_slugs:[]}}],fetch:{},mutations:[]}}(null,"","Moonraker")));